/* eslint-disable jsx-a11y/alt-text */
import React, { Component } from 'react';
import './index.scss';
class SideBar extends Component {
	render() {
		return (
			<nav className={this.props.sideBarStatus ? 'side-bar-container' : 'side-bar-container sideBarHidden'}>
				<img
					src={this.props.sideBarStatus ? '../../../assets/logo-icon.svg' : ''}
					className={this.props.sideBarStatus ? 'hs-label-with-img' : 'hs-img-only'}
				/>
			</nav>
		);
	}
}

export default SideBar;
